pragma solidity ^0.5.10;

contract Ownable {
    address public owner;
    event OwnerChanged(address oldOwner, address newOwner);
    constructor() internal {
        owner = msg.sender;
    }
    modifier onlyOwner() {
        require(msg.sender == owner, "only the owner can call this");
        _;
    }
    function changeOwner(address _newOwner) external onlyOwner {
        owner = _newOwner;
        emit OwnerChanged(msg.sender, _newOwner);
    }
}

contract Stoppable is Ownable {
    bool public isActive = true;
    event IsActiveChanged(bool _isActive);
    modifier onlyActive() {
        require(isActive, "contract is stopped");
        _;
    }
    function setIsActive(bool _isActive) external onlyOwner {
        if (_isActive == isActive) return;
        isActive = _isActive;
        emit IsActiveChanged(_isActive);
    }
}

contract RampInstantPoolInterface {
    uint16 public ASSET_TYPE;
    function sendFundsToSwap(uint256 _amount) public returns(bool success);
}

contract RampInstantEscrowsPoolInterface {
    uint16 public ASSET_TYPE;
    function release(address _pool, address payable _receiver, address _oracle, bytes calldata _assetData, bytes32 _paymentDetailsHash) external;
    function returnFunds(address payable _pool, address _receiver, address _oracle, bytes calldata _assetData, bytes32 _paymentDetailsHash) external;
}

contract RampInstantPool is Ownable, Stoppable, RampInstantPoolInterface {
    uint256 constant private MAX_SWAP_AMOUNT_LIMIT = 1 << 240;
    uint16 public ASSET_TYPE;
    address payable public swapsContract;
    uint256 public minSwapAmount;
    uint256 public maxSwapAmount;
    bytes32 public paymentDetailsHash;
    event ReceivedFunds(address _from, uint256 _amount);
    event LimitsChanged(uint256 _minAmount, uint256 _maxAmount);
    event SwapsContractChanged(address _oldAddress, address _newAddress);
    constructor(address payable _swapsContract, uint256 _minSwapAmount, uint256 _maxSwapAmount, bytes32 _paymentDetailsHash, uint16 _assetType) public validateLimits(_minSwapAmount, _maxSwapAmount) validateSwapsContract(_swapsContract, _assetType) {
        swapsContract = _swapsContract;
        paymentDetailsHash = _paymentDetailsHash;
        minSwapAmount = _minSwapAmount;
        maxSwapAmount = _maxSwapAmount;
        ASSET_TYPE = _assetType;
    }
    function availableFunds() public view returns (uint256);
    function withdrawFunds(address payable _to, uint256 _amount) public returns (bool success);
    function withdrawAllFunds(address payable _to) public onlyOwner returns (bool success) {
        return withdrawFunds(_to, availableFunds());
    }
    function setLimits(uint256 _minAmount, uint256 _maxAmount) public onlyOwner validateLimits(_minAmount, _maxAmount) {
        minSwapAmount = _minAmount;
        maxSwapAmount = _maxAmount;
        emit LimitsChanged(_minAmount, _maxAmount);
    }
    function setSwapsContract(address payable _swapsContract) public onlyOwner validateSwapsContract(_swapsContract, ASSET_TYPE) {
        address oldSwapsContract = swapsContract;
        swapsContract = _swapsContract;
        emit SwapsContractChanged(oldSwapsContract, _swapsContract);
    }
    function sendFundsToSwap(uint256 _amount) public returns(bool success);
    function releaseSwap(address payable _receiver, address _oracle, bytes calldata _assetData, bytes32 _paymentDetailsHash) external onlyOwner {
        RampInstantEscrowsPoolInterface(swapsContract).release(address(this), _receiver, _oracle, _assetData, _paymentDetailsHash);
    }
    function returnSwap(address _receiver, address _oracle, bytes calldata _assetData, bytes32 _paymentDetailsHash) external onlyOwner {
        RampInstantEscrowsPoolInterface(swapsContract).returnFunds(address(this), _receiver, _oracle, _assetData, _paymentDetailsHash);
    }
    function () external payable {
        revert("this pool cannot receive ether");
    }
    modifier onlySwapsContract() {
        require(msg.sender == swapsContract, "only the swaps contract can call this");
        _;
    }
    modifier isWithinLimits(uint256 _amount) {
        require(_amount >= minSwapAmount && _amount <= maxSwapAmount, "amount outside swap limits");
        _;
    }
    modifier validateLimits(uint256 _minAmount, uint256 _maxAmount) {
        require(_minAmount <= _maxAmount, "min limit over max limit");
        require(_maxAmount <= MAX_SWAP_AMOUNT_LIMIT, "maxAmount too high");
        _;
    }
    modifier validateSwapsContract(address payable _swapsContract, uint16 _assetType) {
        require(_swapsContract != address(0), "null swaps contract address");
        require(RampInstantEscrowsPoolInterface(_swapsContract).ASSET_TYPE() == _assetType, "pool asset type doesn't match swap contract");
        _;
    }
}

contract RampInstantEthPool is RampInstantPool {
    uint16 internal constant ETH_TYPE_ID = 1;
    constructor(address payable _swapsContract, uint256 _minSwapAmount, uint256 _maxSwapAmount, bytes32 _paymentDetailsHash) public RampInstantPool(_swapsContract, _minSwapAmount, _maxSwapAmount, _paymentDetailsHash, ETH_TYPE_ID) {}
    function availableFunds() public view returns(uint256) {
        return address(this).balance;
    }
    function withdrawFunds(address payable _to, uint256 _amount) public onlyOwner returns (bool success) {
        _to.transfer(_amount);
        return true;
    }
    function sendFundsToSwap(uint256 _amount) public onlyActive onlySwapsContract isWithinLimits(_amount) returns(bool success) {
        swapsContract.transfer(_amount);
        return true;
    }
    function () external payable {
        require(msg.data.length == 0, "invalid pool function called");
        if (msg.sender != swapsContract) {
            emit ReceivedFunds(msg.sender, msg.value);
        }
    }
}

